import React, { Component } from 'react';
import '../Projects.css'
import {Doughnut} from 'react-chartjs-2';
import Navbar from '../Components/Navbar'
import ReactVivus from 'react-vivus';
import rectangle from '../SVG/rectangle.svg'


const data={
  labels: ["JavaScript", "Python", "Ruby"],
  datasets: [
    {
      label: "My Skills",
      backgroundColor: ["rgb(255, 99, 132)","rgb(54, 162, 235)","rgb(255, 205, 86)"],
      borderColor: 'white',
      data: [50, 50, 50],
  }]
}

class Profile extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh","backgroundColor":"#33466b"}}>
      <Navbar />

      <div style={{"position":"relative"}}>
        <ReactVivus
          id="rectangle"
          option={{
            file: rectangle,
          }}
          style={{ height: '85%%', width: '85%'}}
          callback={console.log}
        />
      </div>

        {/* <div style={{"width":"100%","height":"100%","position":"absolute"}}>
          <div className="skew"></div>
          <div className="skew2"></div>
        </div>*/}

        <div style={{"display":"flex"}} uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
          <div style={{"width":"50%","marginLeft":"100px"}}>
            <div class="uk-card uk-card-default uk-card-body" style={{"position":"absolute","width":"410px","height":"515px","backgroundColor":"#84a3ff"}}></div>
              <div
                style={{"position":"absolute","background":"rgba(0,0,0,0)","box-shadow":"0 0px 0px rgba(0,0,0,0)"}}
                class="uk-card uk-card-default uk-card-body"
              >
                  <img src="pictures/me.jpg" width="410px" height="515px" alt="" uk-img/>
              </div>
            </div>
          <div style={{"height":"400px","width":"35%","marginTop":"100px"}}>
            <div style={{"position":"absolute"}} class="uk-card uk-card-default uk-card-body">
              <div style={{"position":"relative","width":"80%"}}>
                <ReactVivus
                  id="rectangle"
                  option={{
                    file: rectangle,
                  }}
                  style={{ height: '85%%', width: '85%'}}
                  callback={console.log}
                  />
              </div>
              <div style={{"position":"relative"}}>
                  <h3 class="uk-card-title">Brian Yu</h3>
                  <p>Developer fascinated with all things design and UX</p>
                  <p>Interests include: Culinary, Design, Architecture</p>
                  <div style={{"height":"220px","width":"500px", "textAlign":"center"}}>
                    <Doughnut data={data}/>
                  </div>

              </div>
            </div>
          </div>
        </div>
      </div>

    );
  }
}

export default Profile;
